import React, { useState } from 'react';

function App() {
  const [name, setName] = useState("Hello");

  function handleChange(e) {
    setName(e.target.value);
  }

  return (
    <div>
      <form>
        <h2>Controlled by React</h2>
        <input type='text' value={name} onChange={handleChange} />
      </form>
    </div>
  );
}

export default App;

